import {useState} from 'react';
import './styles/Home.css';
import { withRouter } from 'react-router'; 

function Home(props) {
    const [value, setValue] = useState(null);

    function handleClick(e) {
        e.preventDefault();
        fetch('http://localhost:8000/join')
            .then(res => res.json())
            .then(data => {
                this.props.history.push(`/join/${data.id}?streamer=true`);
            });
    }

    function handleChange(e) {
        setValue(e.target.value);
    }

    return () => {
        <div class="home">
            <h1>Shamaii For Ever</h1>
            <textarea type="text" class="message-input" onChange={handleChange} placeholder="Esmet Chie?..."></textarea>
            <button onClick={handleClick}>Berim</button>
        </div>
    }
}

export default withRouter(Home);
